class BaylessAbrahamson2018(GMPE):
    """
    Implements the Bayless and Abrahamson (2018, 2019) model. References:
    - Bayless, J., and N. A. Abrahamson (2018b). An empirical model for Fourier
    amplitude spectra using the NGA-West2 database, PEER Rept. No. 2018/07,
    Pacific Earthquake Engineering Research Center, University of California,
    Berkeley, California.
    - Bayless, J. and N.A. Abrahamson (2019). Summary of the BA18
    Ground-Motion Model for Fourier Amplitude Spectra for Crustal Earthquakes
    in California.  Bull. Seism. Soc. Am., 109(5): 2088â€“2105
    """

    #: Supported tectonic region type is active shallow crust, see title!
    DEFINED_FOR_TECTONIC_REGION_TYPE = const.TRT.ACTIVE_SHALLOW_CRUST

    #: Supported intensity measure types
    DEFINED_FOR_INTENSITY_MEASURE_TYPES = set([EAS])

    #: Supported intensity measure component
    DEFINED_FOR_INTENSITY_MEASURE_COMPONENT = const.IMC.RotD50

    #: Supported standard deviation types
    DEFINED_FOR_STANDARD_DEVIATION_TYPES = set([
        const.StdDev.TOTAL,
        const.StdDev.INTER_EVENT,
        const.StdDev.INTRA_EVENT,
        const.StdDev.SINGLE_STATION
    ])

    #: Required site parameters
    REQUIRES_SITES_PARAMETERS = {'vs30', 'z1pt0'}

    #: Required rupture parameters
    REQUIRES_RUPTURE_PARAMETERS = {'mag', 'rake', 'ztor'}

    #: Required distance measures
    REQUIRES_DISTANCES = {'rrup'}

    def get_mean_and_stddevs(self, sites, rup, dists, imt, stddev_types):
        """
        See :meth:`superclass method
        <.base.GroundShakingIntensityModel.get_mean_and_stddevs>`
        for spec of input and result values.
        """
        mean, stddevs = self._get_mean_and_stddevs(sites, rup, dists, imt,
                                                   stddev_types)
        return mean, stddevs

    def _get_mean_and_stddevs(self, sites, rup, dists, imt, stddev_types):
        # Get the necessary set of coefficients
        C = self.COEFFS[imt]
        # Compute the PGA on bedrock
        ln_ir_outcrop = self._get_ln_ir_outcrop(C, sites, rup, dists)
        # Get th e mean value
        print('-------------------------------------- \n')
        print(C)
        print(imt,
                #self._magnitude_scaling(C, rup),
                #self._path_scaling(C, rup, dists),
                self._site_response(C, sites.vs30, ln_ir_outcrop, imt),
                self._ztor_scaling(C, rup),
                self._normal_fault_effect(C, rup),
                self._soil_depth_scaling(C, sites.z1pt0, sites.vs30))

        mean = (self._magnitude_scaling(C, rup) +
                self._path_scaling(C, rup, dists) +
                self._site_response(C, sites.vs30, ln_ir_outcrop, imt) +
                self._ztor_scaling(C, rup) +
                self._normal_fault_effect(C, rup) +
                self._soil_depth_scaling(C, sites.z1pt0, sites.vs30))
        # Get standard deviations
        stddevs = self._get_stddevs(C, rup, stddev_types, sites.vs30)
        return mean, stddevs

    def _get_ln_ir_outcrop(self, C, sites, rup, dists):
        """
        Compute the natural logarithm of peak PGA at rock outcrop, Ir.
        See eq.10e page 2092.
        """
        # Set imt and cofficients. The value of frequency is consistent with
        # the one used in the matlab script - line 156
        imt = EAS(5.0118725)
        C = self.COEFFS[imt]
        # Get mean
        mean = (self._magnitude_scaling(C, rup) +
                self._path_scaling(C, rup, dists) +
                self._ztor_scaling(C, rup) +
                self._normal_fault_effect(C, rup))
        # Return ln(IR)
        return 1.238 + 0.846 * mean

    def _magnitude_scaling(self, C, rup):
        """ Compute the magnitude scaling term """
        t1 = C['c1']
        t2 = C['c2'] * (rup.mag - 6.)
        tmp = np.log(1.0 + np.exp(C['cn']*(C['cM']-rup.mag)))
        t3 = (C['c2'] - C['c3']) / C['cn'] * tmp
        return t1 + t2 + t3

    def _path_scaling(self, C, rup, dists):
        """ Compute path scaling term """
        tmp = np.maximum(rup.mag-C['chm'], 0.)
        t1 = C['c4'] * np.log(dists.rrup + C['c5'] * np.cosh(C['c6'] * tmp))
        tmp = (dists.rrup**2 + 50.**2)**0.5
        t2 = (-0.5-C['c4'])*np.log(tmp)
        t3 = C['c7'] * dists.rrup
        return t1 + t2 + t3

    def _site_response(self, C, vs30, ln_ir_outcrop, imt):
        """ Compute the site response term """

        # Set the vs30 threshold beyond which non-linearity is not admitted.
        # See page 2092 right column
        delta = 30

        # Linear term
        vsref = np.ones_like(vs30) * 760.
        tmp = np.minimum(vs30, 1000.)
        fsl = C['c8'] * np.log(tmp / 1000.)

        # Non-linear term
        freqs = self._get_frequencies()
        idx = np.argmin(np.abs(freqs - imt.frequency))

        t1 = np.exp(C['f5'] * (np.minimum(vs30, vsref)-360.))
        t2 = np.exp(C['f5'] * (vsref-360))
        f2 = C['f4'] * (t1 - t2)
        print('f2:', f2)

        fnl = f2 * np.log((np.exp(ln_ir_outcrop)+C['f3']) / C['f3'])
        print('---- IR', np.exp(ln_ir_outcrop))
        print('---- site (l, nl, tot)', fsl, fnl, fsl+fnl)

        # Non-linear term
        idx_lo = np.maximum(idx-delta, 0)
        idx_up = np.minimum(idx+delta, 238)
        nl_terms = []
        for f in freqs[idx_lo:idx_up]:
            TC = self.COEFFS[EAS(f)]
            t1 = np.exp(TC['f5'] * (np.minimum(vs30, vsref) - 360))
            t2 = np.exp(TC['f5'] * (vsref-360))
            f2 = TC['f4'] * (t1 - t2)
            fnl = f2 * np.log((np.exp(ln_ir_outcrop)+TC['f3'])/TC['f3'])
            nl_terms.append(fnl)

        """
        meth = sm.nonparametric.lowess
        endog = np.squeeze(np.array(nl_terms))

        if len(endog.shape) > 1:
            fnl = []
            for ed in endog.T:
                tmp = meth(ed, freqs[idx_lo:idx_up], frac=0.9,
                           is_sorted=True, return_sorted=False)
                fnl.append(np.interp(imt.frequency, freqs[idx_lo:idx_up], tmp))
        else:
            tmp = meth(endog, freqs[idx_lo:idx_up], is_sorted=True,
                       return_sorted=False, frac=0.9)
            fnl = [np.interp(imt.frequency, freqs[idx_lo:idx_up], tmp)]

            if False:
                import matplotlib.pyplot as plt
                plt.plot(freqs[idx_lo:idx_up], tmp, label='smoothed')
                plt.plot(freqs[idx_lo:idx_up], nl_terms, label='raw')
                plt.legend()
                plt.show()
        """

        return fsl + fnl

    def _ztor_scaling(self, C, rup):
        """ Compute top of rupture term """
        return C['c9'] * np.minimum(rup.ztor, 20.)

    def _normal_fault_effect(self, C, rup):
        """ Compute the correction coefficient for the normal faulting """
        fnm = 0
        # Compute the normal faulting switch. Rake range as defined at page
        # 2093 top of the right column.
        if rup.rake > -150 and rup.rake < -30:
            fnm = 1
        return C['c10'] * fnm

    def _soil_depth_scaling(self, C, z1pt0, vs30):
        """ Compute the soil depth scaling term """
        # Set the c11 coefficient - See eq.13b at page 2093
        c11 = np.ones_like(vs30) * C['c11a']
        c11[(vs30 <= 300) & (vs30 > 200)] = C['c11b']
        c11[(vs30 <= 500) & (vs30 > 300)] = C['c11c']
        c11[(vs30 > 500)] = C['c11d']
        # Compute the Z1ref parameter
        tmp = (vs30**4 + 610**4) / (1360**4 + 610**4)
        z1ref = 1/1000. * np.exp(-7.67/4*np.log(tmp))
        # Return the fz1 parameter
        tmp = np.minimum(z1pt0, np.ones_like(z1pt0)*2.0) + 0.01
        return c11 * np.log(tmp / (z1ref + 0.01))

    def _get_frequencies(self):
        freqs = []
        for k in self.COEFFS.f_coeffs.keys():
            m = re.match('EAS\((.*)\)', k.__repr__())
            freqs.append(float(m.group(1)))
        return np.array(freqs)

    def _get_stddevs(self, C, rup, stddev_types, vs30):
        """
        Compute the standard deviations
        """
        # Set components of std
        if rup.mag < 4:
            tau = C['s1']
            phi_s2s = C['s3']
            phi_ss = C['s5']
        elif rup.mag > 6:
            tau = C['s2']
            phi_s2s = C['s4']
            phi_ss = C['s6']
        else:
            tau = C['s1']+(C['s2']-C['s1'])/2.*(rup.mag-4)
            phi_s2s = C['s3']+(C['s4']-C['s3'])/2.*(rup.mag-4)
            phi_ss = C['s5']+(C['s6']-C['s5'])/2.*(rup.mag-4)
        # Collect the requested stds
        stddevs = []
        for stddev_type in stddev_types:
            assert stddev_type in self.DEFINED_FOR_STANDARD_DEVIATION_TYPES
            if stddev_type == const.StdDev.TOTAL:
                sigma = np.sqrt(tau**2+phi_s2s**2+phi_ss**2+C['c1a']**2)
                stddevs.append(np.ones_like(vs30) * sigma)
            elif stddev_type == const.StdDev.INTRA_EVENT:
                sigma = np.sqrt(tau**2+phi_s2s**2+phi_ss**2+C['c1a']**2)
                stddevs.append(np.ones_like(vs30) * sigma)
            elif stddev_type == const.StdDev.INTER_EVENT:
                stddevs.append(np.ones_like(vs30) * tau)
            elif stddev_type == const.StdDev.SINGLE_STATION:
                # TODO need to check if the shape correction factor is needed
                # in this case
                sigma = np.sqrt(tau**2+phi_ss**2+C['c1a']**2)
                stddevs.append(np.ones_like(vs30) * sigma)
        return stddevs

